import React, { Component } from 'react';
import {Row, Col, Breadcrumb, Container} from 'reactstrap';
import parse from 'html-react-parser';

class BreadCrumbs extends Component{

    constructor(props) {
		super(props);
		this.state = {};
	}

	render(){
		const pos = {breadcrumb:{size:7, offset:1}}
		return(
			<Breadcrumb>
				<Row>
					<Col xs={pos.breadcrumb} sm={pos.breadcrumb} md={pos.breadcrumb} >
						<Container>
							{parse("Electrónica, Audio y Video > iPod > Reproductores > iPod touch > <b>32 GB</b>")}
						</Container>
					</Col>
				</Row>

                <Col xs={this.props.pos.center} sm={this.props.pos.center} md={this.props.pos.center} className="no-padding-la">

                </Col>
            </Breadcrumb>
		)
	}
}

export default BreadCrumbs;
